import React from 'react'

function Todosave({todolist}) {

    
  return (
    <div>
     {
         todolist.map((todo,index)=>{
         <div key={index}>
             <h5>{todo} <span/> <button>Delete</button></h5>
         </div>
         })
     }
    </div>
  )
}

export default Todosave;
